// Simple test to validate webhook data structure
console.log('Test webhook received data:');
console.log('Full JSON:', JSON.stringify($json, null, 2));

// Test for body wrapper
const hasBody = !!$json.body;
const message = $json.body?.message || $json.message;
const text = message?.text;

console.log('Has body wrapper:', hasBody);
console.log('Message path:', hasBody ? '$json.body.message' : '$json.message');
console.log('Text content:', text);

return [{
  json: {
    status: 'success',
    hasBodyWrapper: hasBody,
    messagePath: hasBody ? '$json.body.message' : '$json.message',
    textContent: text || 'no text',
    timestamp: new Date().toISOString()
  }
}];
